import React, { useState, useEffect } from 'react'

const Register = () => {

  const [firstname, setFirstName] = useState('');
  const [lastname, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  async function register(event) {
    event.preventDefault();
    await fetch('http://localhost:8000/register', {
      method: 'POST',
      body: JSON.stringify({firstname, lastname, email, username, password}),
      headers: {'Content-type': 'application/json'},
    })
  }



  return (
    <form className='register' onSubmit={register} action=''>
      <h1 className='title'>Register New Account</h1>
      <input type='text' className='input-box' placeholder='First Name' required />
      <input type='text' className='input-box' placeholder='Last Name' required />
      <input type='text' className='input-box' placeholder='Email' required />
      <input type='text' className='input-box' placeholder='Username' required />
      <input type='text' className='input-box' placeholder='Password' required />
      <button className='button'>Register</button>
    </form>
  )
}

export default Register
